'GetStartedCommissions'=>'O campanie implicita este creata in timpul instalarii. Puteti sa o modificati pentru a crea propriile campanii <br/> <br/>.
Campaniile sunt utilizate pentru a grupa un set de produse (sau doar un singur produs), care au aceleai setri <br/> <br/>.
