'Set up emails'=>'Seteaza-ti email-ul',
'GetStartedEmails'=>'Ar trebui sa setezi functionalitatea email-ului. Aceasta include: <ul> <li> <strong> <Contul de posta electronica / strong> - cum sunt email-urile trimise. Puteti opta fie pentru functia mail () sau serverul SMTP. </ li> <li> <strong> Sabloanele email-urilor</strong> - acestea sunt sabloanele care sunt folosite atunci cand sistemul trimite automat email-uri, dupa inscriere sau dupa notificarile de vanzare </ li> <li> <strong>Notificarile de e-mail </strong> - puteti configura ce fel de notificari sa primti ca si comerciant si ce notificari vor fi disponibile pentru afiliati. </ li> </ ul> Asigurati-va ca email-ul este configurat corect - incercati sa trimiteti e-mailuri de testare. Fara email-urile de lucru afiliatii nu vor primi confirmarea despre inscrierea lor. etc',
'Customize your affiliate signup form'=>'Personalizeaza-ti cererea de inscriere',
'GetStartedSignupForm'=>'Verificati formularul de inscriere standard, si personalizati-l daca doriti <br/> <br/>.
