'Customize affiliate panel'=>'Personalizati panoul de afiliere',
'GetStartedAffPanel'=>'Panoul de afiliere din Post Affiliate Xpress este foarte flexibil. <br/> Puteti configura meniul dvs., ce sa contina si chiar sa scrieti continul sau link-ul altor pagini.',
'GetStartedIntegrate'=>'Integrarea este o modalitate de a conecta sistemul de afiliat la site-ul dvs. curent, cosul de cumparaturi sau sistemul de plati gateway-ul intr-un mod in care sistemul de afiliere va notifica recomandarile si achizitiile. <br/>
