'Test everything'=>'Testeaza tot',
'GetStartedTest'=>'Cand v-ati configurat campaniile dvs., ati definit comisioanele corect si ati creat unele bannere / link-uri, ar trebui sa testati sistemul. <br/>
Cel mai bine este sa simulati intregul proces al afiliat si din punctul dumneavoastra de vedere:
<ol>
<li> Inscrie-ti unii afiliati de testare - dupa aprobare ar trebui sa primiti e-mail de confirmare cu parola si ar trebui sa va puteti conecta la panoul afiliat </ li>
<li> Conectati-va la panoul de afiliere, pentru a primi coduri pentru bannere / link-uri si puneti-le pe unele pagini de testare </ li>
<li> Faceti clic pe banner si verificati daca clicul este inregistrat </ li>
<li> Dupa clic, incercati sa faceti testul de vanzare si sa verificati daca comisioanele de vanzare au fost inregistrate in sistemul de afiliere (numai pe vanzari sau pe comenziile comisioanelor) </ li>
</> Ol
