'GetStartedPromote'=>'Dupa ce au testat cu succes integrarea sistemului de afiliere cu site-ul dvs., totul este gata pentru a porni programul de promovare a noului afiliat, astfel incat veti atrage afiliati noi sa vi se alature <br/> <br/>.
